import React from 'react';

const Header: React.FC = () => {
    return (
        <header>
            <h1>TalentFlow</h1>
            <nav>
                <ul>
                    <li><a href="/">Jobs</a></li>
                    <li><a href="/candidates">Candidates</a></li>
                    <li><a href="/assessments">Assessments</a></li>
                </ul>
            </nav>
        </header>
    );
};

export default Header;
